import React from "react";
import { StyleSheet, Text, View } from "react-native";

const FlexboxScreen = () => {
    return (
    <View style={{ backgroundColor: "#2F363F", flex: 1, flexDirection: "column" }}>
        <View style={{ backgroundColor: "yellow", width: "100%", height: 50, flexDirection: "row",}} >
        <View style={{ backgroundColor: "green", width: "20%", height: 50,}}> </View>
        <View style={{ backgroundColor: "#36D116", width: "20%", height: 50, }}> </View>
            
</View>
    <View style={{ backgroundColor: "#EC2CC6", width: "100%", height: 75, flexDirection: "row" }}>
    <View style={{ backgroundColor: "#7D1969", width: "20%", height: 75 }}> </View>
    <View style={{ backgroundColor: "red", width: "20%", height: 75}}> </View>
    <View style={{ backgroundColor: "pink", width: "20%", height: 75 }}> </View>
    <View style={{ backgroundColor: "gray", width: "20%", height: 75 }}> </View>
    <View style={{ backgroundColor: "purple", width: "20%", height: 75 }}> </View>
</View>
    <View style={{ backgroundColor: "orange", width: "100%", height: 50 }}> </View>
    <View style={{ backgroundColor: "lightblue", width: "100%", height: "40%" }}> </View>
    <View style={{ backgroundColor: "orange", width: "100%", height: 50 }}> </View>
    <View style={{ backgroundColor: "yellow", width: "100%", height: "50%" }}> </View>
</View>

    );
};

export default FlexboxScreen;
const style = StyleSheet.create({});
